import React, { Component } from "react";
import Projects from "./Projects";
import Skills from "./Skills";
import Experience from "./Experience";

class Home extends Component {
  render() {
    const resumeHomeProjects = this.props.resumeData.projects2;
    const resumePageProjects = this.props.resumeData.projects;

    return (
      <div>
        <Projects
          resumeHomeProjects={
            resumeHomeProjects ? this.props.location.pathname === "/" :
            resumePageProjects ? this.props.location.pathname === "/projects2" :

            this.props.location.pathname === "/"
              ? resumePageProjects
              : resumeHomeProjects
          }
          resumeBasicInfo={this.props.resumeData.basic_info}
        />
        <Skills
          sharedSkills={this.props.sharedData.skills}
          resumeBasicInfo={this.props.resumeData.basic_info}
        />
        <Experience
          resumeExperience={this.props.resumeData.experience}
          resumeBasicInfo={this.props.resumeData.basic_info}
        />
      </div>
    );
  }
}

export default Home;

